if(b.page_type=="search_results"){
    slot_num = 0;
    hotel_results = [];
    jQuery("div.hyatt_hotels_resorts_container div.search-result-item").each(function(){
        slot_num++;
        spirit_code = jQuery(this).children().find('a').attr('rel') || "NA";
        avg_rate = jQuery(this).children().find('a.rateDetOverlayCall').text() || jQuery(this).children().find('a.check-rates-btn').text() || "NA";
        if(avg_rate == "Check Rates"){
            avg_rate = "NoDates";
        }else if(avg_rate!="NA"){
            val = avg_rate.split(' ');
            avg_rate = tealiumiq_currency.convert(val[0],val[1],"USD")
        }

        hotel_results.push(slot_num+","+spirit_code+","+avg_rate);
    })

    b.hotel_search_results = hotel_results.join(':');
}

